comment.body:
the problem is CORS from TruckersMP, so the data is fetched via TruckersMP official API, the problem is that TruckersMP themself don't allow data transfer to other websites due to CORS and can only be fetched via Postman or Mobile API Request. To bypass the CORS, I setup a proxy server to act as a middleman for fetching data by acting as Postman, here's link [HarmanPreet-Singh-XYT/truckersmp-api-proxy](https://github.com/HarmanPreet-Singh-XYT/truckersmp-api-proxy), you simply have to run that server and pass that server's Address:Port into frontend. you can also use docker, here's image name - harmanpreet27/tmp_proxy
if you use docker image then pass PROXY_ORIGIN env variable which is URL of frontend like http://localhost:3000/,
if without docker then only ORIGIN, docker recommended for easy setup.
